/*Table structure for table `frases` */

DROP TABLE IF EXISTS `frases`;

CREATE TABLE `frases` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `frase` varchar(500) DEFAULT NULL,
  `observacion` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=latin1;

/*Data for the table `frases` */

insert  into `frases`(`id`,`frase`,`observacion`) values (1,'Cuando el monje budista volvió al hoyo esperaba ver la momia de su maestro sentada en flor de loto y con una expresión de paz. Al abrir la puerta vio en la momia una expresión de horror y las uñas destruidas por arañar las paredes.','Terror en Frases Cortas'),(2,'Sigo en la bodega del barco escondido. Estoy cansado de comer ratas… por fortuna ya empezaron a morir los hombres.','Terror en Frases Cortas'),(3,'Los sábados, a las diez de la noche, los demonios salen de las botellas para recolectar almas. Los celos y los autos son sus mejores armas.','Terror en Frases Cortas'),(4,'De nada sirvió decirle a la inquisición que se arrepentía de sus pecados; igual lo quemaron. Y al llegar al infierno lo volvieron a quemar.','Terror en Frases Cortas'),(5,'Fue devoto toda su vida. Siempre creyó en el cielo y en el infierno; pero ahora que murió y todo está oscuro no sabe qué hacer.','Terror en Frases Cortas'),(6,'Cuando ella se enteró que estaba siendo raptada, ya era muy tarde: Su piel empezó a desprenderse de sus huesos y sus ojos se hicieron agua. Al llegar, los captores sólo tenían un esqueleto.','Terror en Frases Cortas'),(7,'La abuela, sentada en su mecedora, dejó de respirar ya hace varias horas… pero sigue tarareando esa horrible canción.','Terror en Frases Cortas'),(8,'Ella no supo qué decir cuando vio a su marido allí en la habitación, durmiendo como si nada. ¿Cómo había escapado del sótano donde lo había encerrado después de apuñalarlo?','Terror en Frases Cortas'),(9,'El niño no metía la mano entre la cama y la pared porque temía que la araña del rincón lo picara. Entonces la araña se cansó de esperar y subió hasta su cuello mientras dormía.','Terror en Frases Cortas'),(10,'Se sentía observado, sin saber que era él quien, translucido, observaba...','Terror en Frases Cortas'),(11,'Buscaron a su hijo desaparecido durante doce años, sin saber que cada vez que regaban el jardín también regaban sus huesos.','Terror en Frases Cortas'),(12,'En ese momento por fin se sintió libre, volando, con el cabello danzante por el viento y las gotas refrescantes en el rostro, sus ojos cerrados y una gran sonrisa en sus labios. Al mismo tiempo, sus amigos veían horrorizados como ella desaparecía de la cima de la cascada.','Terror en Frases Cortas'),(13,'La letanía en la pared mencionaba una horrible tortura a una pequeña niña. La letanía era una historia real.','Terror en Frases Cortas'),(14,'Hay tres poderes en el mundo: La inteligencia, el dinero y la belleza; pero sólo los dos primeros son acumulables.','Ensayo sobre el Poder'),(15,'En la sociedad no es lo que sea, es lo que se vea.','Ensayo sobre el Poder'),(16,'En promedio, es la mente mucho más cruel que la realidad.','Ataque de Ansiedad'),(17,'Los artistas no somos mejores que los médicos o los científicos, pero a menudo lo creemos así, ciegos de arrogancia al pensar que nuestra obra es maestra y cambiará al mundo.','Crítica al Artista'),(18,'Si se vive del arte se necesita un mecenas, de lo contrario las obras se convierten en negocios.','Crítica al Artista'),(19,'El hombre busca tener una novia por tres motivos: Sexo, soledad o ego. Pero en general el amor llega sin buscarlo.','Pensamientos'),(20,'Quien se encuentra a gusto con sus defectos, independiente de su edad, está condenado a dejar de evolucionar.','Pensamientos'),(21,'El experto debe enfocarse en una sola área del conocimiento. Quien sabe de todo en verdad sabe poco de todo.','Ensayo sobre el Poder'),(22,'El inicio de la música es el sonido del mar, del viento y de los rayos; el cantar de las aves y el rugir de la lluvia. De las bellas artes, es la música la más degradada.','Crítica al Artista'),(23,'La envidía no se crea por personas que están más arriba o más abajo. Las personas superiores causan admiración y las inferiores causan lástima o desinterés. La envídia se despierta entre pares.','Ensayo sobre el Poder'),(24,'El don del habla a menudo es más fuerte y a la vez más peligroso que el don de la fuerza. La fuerza se aplica contra un enemigo a la vez, mientras que el habla mueve naciones.','Ensayo sobre el Poder'),(25,'Cuando la cabeza se llena de pensamientos futuros, se vuelve tan pesada que impide continuar el camino.','Ataque de Ansiedad'),(26,'El mejor momento de la vida es el ahora, precisamente porque es ahora.','Pensamientos'),(27,'Soy consciente del karma, pero sé que el hombre no obtiene lo que merece, obtiene lo que consigue.','Ensayo sobre el Poder'),(28,'Alcanzar el amor platónico implica quitarse la venda de los ojos, por lo que a menudo significa decepción.','Pensamientos'),(29,'Sabía que María era hermosa, pero un mínimo detalle de fealdad en ella resaltaba como una estrella en medio de una noche sin nubes. La maldición de las mujeres bellas es que la fealdad en ellas se hace más notoria cuando llega, lo que las obliga a estar siempre hermosas.','El Castillo de la Quimera'),(30,'Por instinto nos apegamos a lo conocido, a quien nos parecemos; nos molesta lo inentendible. Los dioses son los que deben adaptarse a sus creyentes, pues de lo contrario los creyentes no comprenderán a los dioses.','Nallhard'),(31,'Era en verdad un completo idiota; pues es bien sabido que no hay que darle poder a un hombre joven, porque a menudo distorsiona su propia realidad.','Eidhard'),(32,'Imaginaba a sus enemigos lerdos, patizambos y débiles; ¿y por qué no los imaginaría así? Si así eran los aldeanos que había conocido toda su vida. El joven pocas veces había visto soldados de verdad, por lo que suponía debían ser como él: valientes, altos y fuertes. Pero no imaginaba así a sus enemigos, pues eran el enemigo y con el enemigo no se tiene empatía.','Eidhard'),(33,'A excepción de dependencias economicas o custodias, la mujer a menudo pierde el poder sobre el hombre si el hombre pierde el interés.','Ensayo sobre el Poder'),(34,'Espero que todo salga bien, pues la verdad cada ataque de Valentina me roba la tranquilidad, y la tranquilidad es la felicidad.','Cada Minuto a su Lado'),(35,'Mi madre me dice que mi hermana me está esperando en la sala. Pero es imposible porque yo ya quemé el cuerpo. Voy a la sala y veo la parte posterior de su cabeza y su espalda erguida… no quiero ver su rostro.','Terror en Frases Cortas'),(37,'Apenas entré a la tienda sentí todas las terribles miradas sobre mí. Caminé por todos lados y me di cuenta que me seguían con sus ojos vacíos, como vigilantes, sin mover sus cabezas. Era horrible sentir esas miradas. La tienda era una fábrica vieja de muñecas.','Terror en Frases Cortas'),(38,'Cuando por fin pudo vomitar, sintió cómo salía de su garganta ese horrible y largo parásito. Cuando ya estuvo finalmente en el suelo, el horrible y pegajoso invertebrado le dijo: - “Por favor, déjame volver a entrar”.','Terror en Frases Cortas'),(39,'Cada vez subía más el volumen de la música, sólo para acallar los gritos del sótano.','Terror en Frases Cortas'),(40,'El niño lloró al ver su muñeco favorito de pie sobre la mesa, pues recordó que antes del accidente él también podía ponerse de pie.','Terror en Frases Cortas'),(41,'Él espero por ella bajo la lluvia mucho tiempo, pero ella ni siquiera se había dado cuenta que estaba lloviendo.','Terror en Frases Cortas'),(42,'Las dos variables del éxito o del fracaso son la inteligencia y la disciplina, aunque la suerte a menudo influye.','Ensayo sobre el Poder'),(43,'A menudo las mujeres independientes causan desinterés en los hombres. Esto se puede dar por inseguridad del hombre o porque no despiertan el instinto paternal y protector.','Ensayo sobre el Poder'),(44,'El grito es el sonido de la ignoracia, el temor y la impotencia.','Ensayo sobre el Poder'),(45,'Es preferible conocer la obra antes que al artista. De lo contrario la subjetividad hacia el autor deformará la percepción hacia la obra.','Crítica al Artista'),(46,'El dinero y la belleza abren puertas, pero sus dueños se encargan de cerrarlas.','Ensayo sobre el Poder'),(47,'La bondad traerá paz, y la paz felicidad. El tirano nunca conciliará el sueño.','Ensayo sobre el Poder'),(48,'La duda puede estar en la planeación, pero nunca en la acción.','Pensamientos'),(49,'Todo lo que se politiza se pudre. Claros ejemplos son: la religión, la ley, la industria. Todo se daña.','Ensayo sobre el Poder'),(50,'Mantenerse en la cima resulta más estresante que llegar a ella.','Ensayo sobre el Poder'),(51,'Llegar al cielo desde el infierno permite al alma conocer todo el camino. Nacer en el cielo y caer al infierno es mucho más trágico.','Pensamientos'),(52,'Ningún artista es verdaderamente original. Todos imitamos a nuestros maestros. La única diferencia es que algunos los superan en fama y otros logran mantener ocultas sus fuentes.','Crítica al Artista'),(53,'Se debe ser un buen vendedor, incluso de su propia imagen. Se puede tener el mejor producto del mundo, pero si permanece en una gaveta y nadie lo conoce entonces no existe.','Ensayo sobre el Poder'),(54,'La soledad voluntaria es muy diferente a la soledad obligatoria. La primera es un privilegio, pero la segunda es un verdadero tormento.','Pensamientos'),(55,'Quien desea el mal a otras personas sólo quiere hacer menos profunda su miseria.','Pensamientos'),(56,'La expresión \"Es que usted no sabe qué es la vida\" normalmente nace del dolor y del resentimiento, pues asume que vivir la vida es sufrimiento. La vida consiste en alcanzar metas, pequeñas o grandes, aunque el sufrimiento esté constantemente entre ellas y nosotros.','Pensamientos'),(57,'La zona de \"confort\" debe ser abandonada cuando en verdad no es de \"confort\", pero si esta zona trae felicidad, piensa que invertiste muchos años en crearla para abandonarla sin motivo.','Pensamientos'),(58,'Pero la desgracia llegó el cuarto día, vestida con belleza, como el Demonio la prefiere.','El Imperio de los Dos Soles'),(59,'La vanidad es la característica del género femenino; y el verse opacada por la belleza de otra mujer es simplemente desaparecer.','El Imperio de los Dos Soles'),(60,'Espero que pocos amen mi arte. Si la masa adopta lo que escribo, entonces estoy haciendo algo mal. El arte es exclusivo, y prefiero que pocos sientan mi escritura a que muchos simplemente la acaricien. Un ejemplo es la biblia: todos la conocen, pero pocos en verdad la leen.','Crítica al Artista'),(61,'Los humanos siempre desean más, sin conformarse nunca. Parecemos una horrible bestia que siempre tiene hambre, y que tarde o temprano resultará comiéndose a sí misma, pues con el tiempo ya todo lo habrá devorado.','El Imperio de los Dos Soles'),(62,'Espero que el hombre tenga mucha capacidad de crear, para que cuando lo haya destruido todo sea capaz de reconstruirlo.','El Imperio de los Dos Soles'),(63,'El mundo es pequeño en el universo, pero no lo suficiente para la mano de un solo Hombre.','El Imperio de los Dos Soles'),(64,'El Hombre es el que pone sus propios imposibles, pero culpa a sus metas.','La Edad de las Estrellas'),(65,'Uno no tiene lo que se merece, uno tiene lo que consigue.','La Edad de las Estrellas'),(66,'Idiotas han habido en todas las generaciones, pero con las redes sociales evidenciamos su enorme cantidad.','Pensamientos'),(67,'El problema del fanatismo y el extremismo es que convierte las causas justas en simples burlas.','Pensamientos'),(68,'La belleza sólo existe cuando se ve, pero no trasciende ni cambia el curso del mundo. La mujer que es sólo bella físicamente es olvidada si no es visible.','Ensayo sobre el Poder'),(69,'Rebajar o criticar las virtudes de los demás es un simple autoengaño para hacer la vida menos miserable.','Pensamientos'),(70,'La valentía crece al sentir el peligro alejado. Insultar es sencillo cuando no se tiene al insultado al frente.','Pensamientos'),(71,'Cuando el conocimiento es desproporcionado en una discusión, siempre ganará el idiota, pues el intelecto intenta llegar a consensos, mientras la idiotez simplemente se cierra al aprendizaje. Sólo puede haber debate sano entre mentes abiertas.','Ensayo sobre el Poder'),(72,'Imagina no poder descansar del dolor y del sufrimiento, del hambre y de la sed, del frío y del ardor. La prolongación de una mala vida es una maldición','La Edad de las Estrellas'),(73,'Deja la esperanza, pues la esperanza causa miedo de no cumplirse. Sólo vive el presente.','Pensamientos'),(74,'Debes tener la mente como un lago calmo y limpio, he ahí la tranquilidad y la lucidez que lleva a la plenitud.','Pensamientos'),(75,'Si tu mente vaga fuera del presente puedes caer en el vacío del aburrimiento o en el caos de la \r\ninquietud.','Pensamientos'),(76,'Sólo las mentiras deben ser ratificadas continuamente. La verdad no requiere memoria.','Pensamientos'),(77,'Ella era de rizos castaños, de ojos verdes como jades, de rostro fino y de facciones que se acercaban a la perfección y al gusto de todos los mortales. Parecía ser el deleite de los Ángeles, la envidia de la belleza, la presa de las beldades y la tentación de los Demonios. Irradiaba un aura enigmática, de calma, e inmolaba sentimientos muy profundos.','La Edad de las Estrellas'),(78,'La primera bestia emergió vestida de llamas rojas, derritiendo todo a su alrededor, y calcinando con su intolerancia carne y tendones de conocidos y desconocidos. ','La Canción Glacial'),(79,'A menudo los hombres tienen una gran ceguera para justificar sus actos en vez de admitir sus errores.','La Edad de las Estrellas'),(80,'La verdad temo que todo salta mal, pero debo dudar antes de ejecutar, porque después de ejecutado no puedo tener dudas.','La Edad de las Estrellas'),(81,'En la adolescencia y en la juventud, el poder entre los hombres y las mujeres es desproporcionado. Ellas siempre dominarán a los veinte años. Los hombres deben llenarse de paciencia, pues sólo después de los treinta años la balanza puede empezar a cambiar.','Ensayo sobre el Poder'),(82,'Estaba listo para ir a dormir, pero sentí de nuevo el hedor nauseabundo y escuché el lento chirriar de la puerta. Entonces supe que ese maldito perro se había desenterrado de nuevo. Ya casi no tenía piel en los huesos, y no tenía ojos ni orejas. Pero lo dejaré dormir de nuevo hoy a mis pies, aunque apeste. Mañana lo enterraré de nuevo en el cementerio de animales.','Terror en Frases Cortas'),(83,'Ella intentaba salvar a los marineros al otro lado del agua, sin saber que ella, con su canto, era quien los ahogaba.','Terror en Frases Cortas'),(84,'La nevera estaría vacía si los pedazos de su pareja no estuvieran allí.','Terror en Frases Cortas'),(85,'Todos los mineros dejaron de cavar el túnel cuando escucharon un llanto de un bebé… a kilómetros de profundidad.','Terror en Frases Cortas'),(86,'Era tan bella que cualquier imperfección le parecía monstruosa, y llevada por la vanidad en verdad se convirtió en un monstruo.','Terror en Frases Cortas'),(87,'Toda la familia quedó sorprendida al ver que la foto en el ataúd no era la del fallecido, sino la de su hijo, presente en el funeral. Pensaron que fue un error, pero en verdad fue una premonición cumplida tan sólo dos días después.','Terror en Frases Cortas'),(88,'Después de muchos años de encierro por fin sentía el viento en su rostro, el problema es que al mismo tiempo sentía la terrible soga en el cuello.','Terror en Frases Cortas'),(89,'Si los fantasmas en verdad existen, entonces debe haber más fantasmas que seres humanos.','Terror en Frases Cortas'),(90,'Decidió mutilarse cuando sus piernas empezaron a hablarle.','Terror en Frases Cortas'),(91,'No hay mayor bajeza que disfrazar el privilegio con arengas de igualdad.','Ensayo sobre el Poder'),(92,'La soledad voluntaria puede ser reconfortante, sosegada, incluso maravillosa; pues permite un reencuentro entre el cuerpo y el alma. Pero la soledad obligada es horrible, pesada, lacera el pensamiento y empuja a la locura. Por eso es un castigo en las cárceles. Que no hable de soledad quien nunca ha estado obligado a estar solo.','Pensamientos'),(93,'Subió las escaleras del templo al alba. Se posó frente a la estatua de Buda, se arrodilló y rezó con profundidad. Y cuando abrió los ojos vio, aterrorizado, que la estatua de piedra también tenía los ojos abiertos, muy abiertos.','Terror en Frases Cortas'),(94,'Muchos se disparan en la cabeza, pero antes gritan que los demás cargaron el arma. Esto no sólo demuestra cobardía, también demuestra la incapacidad de manejar un problema... y no hablo necesariamente de un suicidio.','Pensamientos'),(95,'Nunca hubo tantos idiotas en el mundo, pero tampoco hubo nunca tantas mentes brillantes. El problema es que a los genios sólo se les reconoce cuando ya no están. Incluso, a menudo ni se les reconoce.','Pensamientos'),(96,'Quien culpa a los demás es incapaz de evolucionar, porque se enfoca en los problemas externos en vez de los internos.','Pensamientos'),(97,'Entre más simples los gustos, más felicidad se abarca.','Pensamientos'),(98,'La crueldad hacia la humanidad puede ser impulsada por la venganza; pero la verdadera crueldad se muestra en quien maltrata a los animales. Quien daña a los animales no se venga, es simplemente maligno.','Pensamientos'),(99,'Quien es feliz no discute.','Pensamientos'),(100,'Hay dos variables que determinan el éxito: la disciplina y la inteligencia. Pero hay una tercera que casi siempre es determinante: la suerte. Sólo el país donde naces y el idioma que hablas puede inhabilitar las dos primeras.','Ensayo sobre el Poder'),(101,'Tal felicidad era sólo una ilusión, pues sabían que la armonía y la tranquilidad no eran eternas, sólo prolongables, al igual que la belleza.','La Edad de las Estrellas'),(102,'Aún tengo el recuerdo de mi hermana, encorvada sobre la cama, convertida completamente en un monstruo; y esa horrible imagen es la que viene a mí en las noches, cuando todo está oscuro y en silencio, atormentándome hasta que llega de nuevo el alba.','Monstruo');

/*Table structure for table `obras` */

DROP TABLE IF EXISTS `obras`;

CREATE TABLE `obras` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `nombre_obra` varchar(150) DEFAULT NULL,
  `vistos` int(10) DEFAULT NULL,
  `likes` int(10) DEFAULT NULL,
  `puntuacion` int(3) DEFAULT NULL,
  `tipo` tinyint(2) DEFAULT NULL COMMENT '1=>cuento, 2=>poema,3=>libro',
  `id_superior` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_superior` (`id_superior`),
  CONSTRAINT `obras_ibfk_1` FOREIGN KEY (`id_superior`) REFERENCES `obras` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=latin1;

